//           en: "His only purpose was to protect his master. And yet he was powerless to protect her. But fate has more in store for him as he gets another chance to protect his master once more and change his destiny.\n\n---\n\n**Links:**\n- [Original Webtoon (Kakao) Season 2-3](https://page.kakao.com/content/54097394)\n- [Orginal Webtoon (Kakao Webtoon)](https://webtoon.kakao.com/content/%ED%95%B4%EA%B3%A8%EB%B3%91%EC%82%AC%EB%8A%94-%EB%8D%98%EC%A0%84%EC%9D%84-%EC%A7%80%ED%82%A4%EC%A7%80-%EB%AA%BB%ED%96%88%EB%8B%A4/2358)\n- [Official Japanese Translation](https://piccoma.com/web/product/8627)\n- [Official German Translation](https://www.tappytoon.com/de/comics/skeleton-soldier-failed-defend-dungeon-de)\n- [Official French Translation](https://www.tappytoon.com/fr/comics/skeleton-soldier-failed-defend-dungeon-fr)\n- [Official Simplified Chinese Translation](https://manga.bilibili.com/detail/mc28241)\n- [Official Traditional Chinese Translation](https://tw.kakaowebtoon.com/content/%E9%AA%B7%E9%AB%8F%E5%A3%AB%E5%85%B5%E5%8D%B7%E5%9C%9F%E9%87%8D%E4%BE%86/152)",
//           fr: "D\u00e9couvrez le Soldat Squelette, le fr\u00eale mais loyal combattant, se battant pour prot\u00e9ger sa ma\u00eetresse, Dame Succube. Son r\u00eave d'une vie paisible \u00e0 ses c\u00f4t\u00e9s est r\u00e9duit \u00e0 n\u00e9ant le jour o\u00f9 ils sont tous les deux brutalement assassin\u00e9s par un groupe de guerriers. Mais ce qui allait \u00eatre une fin tragique se r\u00e9v\u00e8le \u00eatre en fait un nouveau commencement : le Soldat Squelette se r\u00e9veille de nouveau... 20 ans plus t\u00f4t ! Il doit pr\u00e9venir sa Dame du danger qui les guette, mais sans comp\u00e9tences au combat, et un large historique de d\u00e9faites, sera-t-il capable de sauver leur avenir ? Suivez ce courageux squelette dans sa qu\u00eate pour changer le cours du temps et son tragique destin !",
