//         description: {
//           en: "Civilization is dead, but Chito and Yuuri are still alive. \nSo they hop aboard their Kettenkrad motorbike and aimlessly wander the ruins of the world they once knew. \nDay after hopeless day, they look for their next meal and fuel for their ride. \nBut as long as they are together, even an existence as bleak as theirs has a ray or two of sunshine in it, \nwhether they're sucking down their fill of soup or hunting for machine parts to tinker with. \nThe experiences and feelings these two girls share in a world full of nothing give them something to live for\u2026  \n  \n---\n- **Won the Seiun Award for Best Comic in 2019**",
//           id: "Peradaban tewas, tapi Chito dan Yuuri masih hidup. Jadi mereka naik sepeda motor Kettenkrad tersayang mereka dan bermondar-mandir tanpa tujuan reruntuhan dunia yang mereka dulu kenal. Hari demi hari tanpa harapan, mereka mencari makanan berikut mereka dan bensin untuk kendaraan mereka. Tapi selama mereka berdua bersama, bahkan kehidupan seguram mereka masih ada sedikit kesenangan di dalamnya, entah minum sup entah mencari bagian-bagian mesin untuk menggerumit. Untuk dua putri di dalam dunia kosong, pengalaman dan perasaan keduanya bersama ada memberi mereka alasan untuk hidup...\n\n- Pemenang Penghargaan Seiun (Nebula) Jepang dalam kategori Komik/Manga terbaik di 2019.",
//           ru: "\u041c\u0438\u0440 \u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e. \u0427\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u0430\u044f \u0446\u0438\u0432\u0438\u043b\u0438\u0437\u0430\u0446\u0438\u044f \u0434\u043e\u0441\u0442\u0438\u0433\u043b\u0430 \u043d\u0435\u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e\u0433\u043e \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u043e\u0433\u0440\u0435\u0441\u0441\u0430 \u0438 \u043e\u0434\u043d\u0430\u0436\u0434\u044b \u043f\u043e\u0441\u0442\u0440\u043e\u0438\u043b\u0430 \u0441\u0435\u0431\u0435 \u0433\u0438\u0433\u0430\u043d\u0442\u0441\u043a\u0438\u0435 \u043c\u043d\u043e\u0433\u043e\u0443\u0440\u043e\u0432\u043d\u0435\u0432\u044b\u0435 \u0433\u043e\u0440\u043e\u0434\u0430, \u0432 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u043f\u0440\u043e\u0436\u0438\u0432\u0430\u043b\u043e \u043e\u0433\u0440\u043e\u043c\u043d\u043e\u0435 \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u043b\u044e\u0434\u0435\u0439. \u041e\u0434\u043d\u0430\u043a\u043e \u0447\u0435\u0440\u0435\u0437 \u043a\u0430\u043a\u043e\u0435-\u0442\u043e \u0432\u0440\u0435\u043c\u044f \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u0432\u043e\u0439\u043d\u0430, \u043f\u043e\u0441\u043b\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u043e \u043e\u043a\u0430\u0437\u0430\u043b\u043e\u0441\u044c \u043d\u0430 \u0433\u0440\u0430\u043d\u0438 \u0432\u044b\u043c\u0438\u0440\u0430\u043d\u0438\u044f.\n\u0421\u043f\u0443\u0441\u0442\u044f \u043c\u043d\u043e\u0433\u043e \u043b\u0435\u0442 \u0432 \u043e\u0434\u043d\u043e\u043c \u0438\u0437 \u0442\u0430\u043a\u0438\u0445 \u0433\u043e\u0440\u043e\u0434\u043e\u0432 \u043c\u044b \u0432\u0441\u0442\u0440\u0435\u0447\u0430\u0435\u043c \u0422\u0438\u0442\u043e \u0438 \u042e\u0440\u0438. \u042d\u0442\u0438 \u0434\u0432\u0435 \u043c\u0430\u043b\u0435\u043d\u044c\u043a\u0438\u0435 \u0434\u0435\u0432\u043e\u0447\u043a\u0438 \u0438\u0437\u043e \u0434\u043d\u044f \u0432 \u0434\u0435\u043d\u044c \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0443\u044e\u0442 \u043d\u0430 \u0441\u0432\u043e\u0451\u043c \u043c\u043e\u0434\u0438\u0444\u0438\u0446\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u043c Kettenkrad \u0432 \u043f\u043e\u0438\u0441\u043a\u0430\u0445 \u043f\u0440\u043e\u043f\u0438\u0442\u0430\u043d\u0438\u044f \u0438 \u0440\u0435\u0441\u0443\u0440\u0441\u043e\u0432.\n\u0414\u0432\u0438\u0436\u0438\u043c\u044b\u0435 \u0436\u0435\u043b\u0430\u043d\u0438\u0435\u043c \u0437\u0430\u0431\u0440\u0430\u0442\u044c\u0441\u044f \u043d\u0430 \u0441\u0430\u043c\u0443\u044e \u0432\u0435\u0440\u0448\u0438\u043d\u0443 \u044d\u0442\u043e\u0433\u043e \u043e\u043f\u0443\u0441\u0442\u0435\u0432\u0448\u0435\u0433\u043e \u0433\u043e\u0440\u043e\u0434\u0430-\u0438\u0441\u043f\u043e\u043b\u0438\u043d\u0430, \u043e\u043d\u0438 \u043f\u043e\u0441\u0442\u043e\u044f\u043d\u043d\u043e \u0441\u0442\u0430\u043b\u043a\u0438\u0432\u0430\u044e\u0442\u0441\u044f \u0441\u043e \u0432\u0441\u0451 \u043d\u043e\u0432\u044b\u043c\u0438 \u0438 \u043d\u043e\u0432\u044b\u043c\u0438 \u0437\u0430\u0433\u0430\u0434\u043e\u0447\u043d\u044b\u043c\u0438 \u0441\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u044f\u043c\u0438, \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0430\u043c\u0438 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0438 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u0438 \u0434\u0430\u0436\u0435 \u0441 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u043c\u0438 \u0434\u0440\u0443\u0433\u0438\u043c\u0438 \u0432\u044b\u0436\u0438\u0432\u0448\u0438\u043c\u0438. \u0427\u0442\u043e \u0436\u0435 \u0431\u0443\u0434\u0435\u0442 \u0436\u0434\u0430\u0442\u044c \u0438\u0445 \u0432 \u043a\u043e\u043d\u0446\u0435 \u044d\u0442\u043e\u0439 \u0434\u043b\u0438\u043d\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u0438?",
