//           {
//             ru: "\u0424\u0430\u043b\u044c\u0448\u0438\u0432\u0430\u044f \u0441\u0432\u044f\u0442\u0430\u044f, \u043e\u0442\u0431\u0440\u043e\u0441 \u0433\u043e\u0434\u0430. ~\u0418\u0434\u0435\u0430\u043b\u044c\u043d\u0430\u044f \u0441\u0432\u044f\u0442\u0430\u044f? \u041d\u0435\u0442, \u0432\u0441\u0435\u0433\u043e \u043b\u0438\u0448\u044c \u043f\u043e\u0434\u0434\u0435\u043b\u043a\u0430!~",
