//         description: {
//           en: "[The Eternal Scattering Flowers: Fiore Caduto Eterna] is a game ill-suited of being known as a galge, as the main heroine would \u2013 regardless of the chosen route \u2013 meet her demise.\n\nFudou Niito, a resident of Japan, went to bed dissatisfied with the ending of the game. When he next awoke, he found himself in the body of the game\u2019s hated fake saint, Elrise.\n\nConfused, but with an understanding that Elrise\u2019s actions would spell disaster for many lives in the future, he took advantage of the situation and acted to change the course of history.\n\nAs a result, despite her rotten personality, Elrise was adored by those around her as a perfect saint. Furthermore, the game itself was intrinsically linked to his original world and changed accordingly to suit Elrise\u2019s actions. Without any knowledge of what the hell was going on, the fake saint Elrise continued to alter her fate.\n\nA saint on the outside, but a man on the inside.\n\nThe transmigrator was a piece of shit and the person he transmigrated into was also a piece of shit. A combination of shit and shit would cause an accident \u2013 to create the greatest fake saint shitshow of the year!",
//           id: "[The Eternal Scattering Flowers: Fiore Caduto Eterna] adalah sebuah permainan yang tidak cocok untuk di panggil sebagai galge, karena apapun rute yang di pilih heroine utama akan selalu menemui ajalnya.\n\nFudou Niito, seorang penduduk di jepang, pergi tidur dengan ketidakpuasan pada akhir dari gamenya. Selanjutnya ketika dia terbangun, ia menemukan dirinya berada dalam tubuh seorang saint yang di benci dalam game, Elrise.\n\nDia kebingungan, namun dengan pemahaman bahwa tindakan Elrise akan menyebabkan bencana untuk banyak kehidupan di masa depan, dia memanfaatkan situasi itu dan bertindak untuk mengubah jalannya sejarah.\n\nSebagai hasilnya, terlepas dari kepribadian busuknya, Elrise di cintai oleh orang-orang di sekitarnya sebagai seorang saint yang sempurna. Terlebih lagi, game itu sendiri pada intinya terhubung dengan dunia asli tempatnya berada dan berubah berdasarkan tindakan Elrise. Tanpa mengetahui apa yang sedang terjadi, seorang saint palsu Elrise terus-menerus mengubah takdirnya.\n\nSeorang saint di luar, namun pria di dalamnya.\n\nOrang yang merasuki adalah seorang bajingan dan orang yang di rasukinya juga merupakan seorang bajingan. Kombinasi dari para bajingan akan menyebabkan mala petaka yang akan menciptakan pertunjukan saint palsu bajingan terbesar tahun ini!",
//           ru: "\u0412\u0438\u0437\u0443\u0430\u043b\u044c\u043d\u044b\u0439 \u0440\u043e\u043c\u0430\u043d \u00ab\u041a\u0443\u043e\u043d \u043d\u043e \u0421\u0430\u043d\u043a\u0430 ~Fiore caduto eterna~\u00bb \u2014 \u043d\u0435\u0441\u043f\u0440\u0430\u0432\u0435\u0434\u043b\u0438\u0432\u0430\u044f \u0438\u0433\u0440\u0430, \u0433\u0434\u0435 \u0432 \u043a\u0430\u0436\u0434\u043e\u0439 \u0438\u0437 \u0432\u0435\u0442\u043e\u043a \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0433\u043b\u0430\u0432\u043d\u0430\u044f \u0433\u0435\u0440\u043e\u0438\u043d\u044f \u0443\u043c\u0438\u0440\u0430\u0435\u0442. \u042f, \u043f\u0435\u0440\u0435\u0440\u043e\u0434\u0438\u0432\u0448\u0438\u0439\u0441\u044f \u0432 \u043f\u043e\u0434\u0434\u0435\u043b\u044c\u043d\u0443\u044e \u0441\u0432\u044f\u0442\u0443\u044e-\u0437\u043b\u043e\u0434\u0435\u0439\u043a\u0443 \u0438\u0433\u0440\u044b \u042d\u043b\u044c\u0440\u0438\u0437\u0435, \u0440\u0435\u0448\u0438\u043b \u043f\u043e \u043f\u043e\u043b\u043d\u043e\u0439 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u0432\u0441\u0435 \u0441\u0432\u043e\u0438 \u0437\u043d\u0430\u043d\u0438\u044f \u043e\u0431 \u0438\u0433\u0440\u0435, \u0447\u0442\u043e\u0431\u044b \u0441\u043f\u0430\u0441\u0442\u0438 \u0433\u043b\u0430\u0432\u043d\u0443\u044e \u0433\u0435\u0440\u043e\u0438\u043d\u044e, \u042d\u0442\u0435\u0440\u043d\u0443, \u043e\u0434\u043d\u0430\u043a\u043e\u2026\n\n\u0412\u043d\u0435\u0448\u043d\u043e\u0441\u0442\u044c \u0441\u0432\u044f\u0442\u043e\u0439 \u0434\u0435\u0432\u044b, \u0430 \u0432\u043d\u0443\u0442\u0440\u0438 \u043c\u0443\u0436\u0438\u043a. \u0414\u0435\u0440\u044c\u043c\u043e\u0432\u043e\u0439 \u0434\u0443\u0448\u0435 \u2014 \u0434\u0435\u0440\u044c\u043c\u043e\u0432\u044b\u0439 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436. \u041a\u0430\u043a \u0436\u0435 \u0440\u0430\u0437\u0432\u0435\u0440\u043d\u0451\u0442\u0441\u044f \u0438\u0441\u0442\u043e\u0440\u0438\u044f, \u0433\u0434\u0435 \u043f\u043e