//           en: "Kang Minhyuk suffers from a rare disorder that makes it impossible for him to stop eating. Despite strict diet and exercise, Minhyuk\u2019s weight is now life-threatening. As a last resort, his doctor recommends a unique treatment\u2014Athenae, a VR game where one can eat as much as they want without consequence. Crispy fried chicken! Scrumptious samgyetang! Inside Athenae, all food tastes real, but earning it is no cakewalk. In order to live, Minhyuk must go on the ultimate fantasy gourmet adventure!\n\n---\n- [Original Webtoon <Webtoon kakao>](https://webtoon.kakao.com/content/%EB%B0%A5%EB%A7%8C-%EB%A8%B9%EA%B3%A0-%EB%A0%88%EB%B2%A8%EC%97%85/2382)\n---\n\n- [Official Traditional Chinese Translation](https://tw.kakaowebtoon.com/content/%E5%90%83%E8%B2%A8%E7%9A%84%E7%A7%81%E6%88%BF%E5%8D%87%E7%B4%9A%E9%A4%90/111)\n\n- [Official Simplified Chinese Translation](https://ac.qq.com/Comic/comicInfo/id/648815)\n\n- [Official Indonesian Translation](https://id.kakaowebtoon.com/content/Leveling-Up-Only-by-Eating/98)\n\n- [Official Japanese Translation](https://piccoma.com/web/product/63110)\n\n- [Official Thai Translation](https://th.kakaowebtoon.com/content/%E0%B8%81%E0%B8%B4%E0%B8%99%E0%B8%88%E0%B8%B8%E0%B8%97%E0%B8%B0%E0%B8%A5%E0%B8%B8%E0%B9%80%E0%B8%A5%E0%B9%80%E0%B8%A7%E0%B8%A5/211)",
//           id: "Menderita penyakit langka di mana hanya ada dua orang penderita di seluruh dunia, Minhyuk harus hidup sambil mengontrol nafsu makannya. Segala cara sudah dicoba untuk mengurangi berat badan Minhyuk, namun itu hanya semakin membuatnya lapar hingga dokter pribadinya menyarankan 'Athenae'. Sebuah VR Game di mana pemainnya bisa makan sepuasnya di dalam sana tanpa khawatir berat badan naik. Begitulah petualangan Minhyuk dimulai, tentu saja ditemani makanan-makanan lezat pada setiap quest-nya!\n\n---\n- [Original Webtoon <Webtoon kakao>](https://webtoon.kakao.com/content/%EB%B0%A5%EB%A7%8C-%EB%A8%B9%EA%B3%A0-%EB%A0%88%EB%B2%A8%EC%97%85/2382)\n---\n\n- [Official Traditional Chinese Translation](https://tw.kakaowebtoon.com/content/%E5%90%83%E8%B2%A8%E7%9A%84%E7%A7%81%E6%88%BF%E5%8D%87%E7%B4%9A%E9%A4%90/111)\n\n- [Official Simplified Chinese Translation](https://ac.qq.com/Comic/comicInfo/id/648815)\n\n- [Official Indonesian Translation](https://id.kakaowebtoon.com/content/Leveling-Up-Only-by-Eating/98)\n\n- [Official Japanese Translation](https://piccoma.com/web/product/63110)\n\n- [Official Thai Translation](https://th.kakaowebtoon.com/content/%E0%B8%81%E0%B8%B4%E0%B8%99%E0%B8%88%E0%B8%B8%E0%B8%97%E0%B8%B0%E0%B8%A5%E0%B8%B8%E0%B9%80%E0%B8%A5%E0%B9%80%E0%B8%A7%E0%B8%A5/211)",
//           it: 'personaggio principale \u00e8 colpito da una rara condizione che colpisce solo due persone in tutto il mondo, la bulimia. Organizza i suoi pasti quotidiani per sopravvivere, ma la sua speranza di sopravvivenza si affievolisce con il passare dei giorni. Consulta un medico, che gli suggerisce di giocare al gioco della realt\u00e0 alternativa "Athenae", dove pu\u00f2 mangiare quanto vuole senza ingrassare. Gioca per salvarsi la vita e crescere in forza non facendo altro che mangiare! Una vita fantastica da gourmet!\n\n---\n- [Original Webtoon <Webtoon kakao>](https://webtoon.kakao.com/content/%EB%B0%A5%EB%A7%8C-%EB%A8%B9%EA%B3%A0-%EB%A0%88%EB%B2%A8%EC%97%85/2382)\n---\n\n- [Official Traditional Chinese Translation](https://tw.kakaowebtoon.com/content/%E5%90%83%E8%B2%A8%E7%9A%84%E7%A7%81%E6%88%BF%E5%8D%87%E7%B4%9A%E9%A4%90/111)\n\n- [Official Simplified Chinese Translation](https://ac.qq.com/Comic/comicInfo/id/648815)\n\n- [Official Indonesian Translation](https://id.kakaowebtoon.com/content/Leveling-Up-Only-by-Eating/98)\n\n- [Official Japanese Translation](https://piccoma.com/web/product/63110)\n\n- [Official Thai Translation](https://th.kakaowebtoon.com/content/%E0%B8%81%E0%B8%B4%E0%B8%99%E0%B8%88%E0%B8%B8%E0%B8%97%E0%B8%B0%E0%B8%A5%E0%B8%B8%E0%B9%80%E0%B8%A5%E0%B9%80%E0%B8%A7%E0%B8%A5/211)',
